import React, { Component } from "react";

class HomeComponent extends Component {
  checkSignIn() {
    if (localStorage.getItem("user")) {
      this.props.history.push("/search");
    }
  }
  render() {
    this.checkSignIn();
    return (
      <div className="d-flex justify-content-center align-items-center home ">
        <div className="card">
          <h2 className="display-4 d-flex justify-content-center">Welcome!</h2>
          <div className="card-body">
            Sign in or Sign up to let us help you fly away to your next dream
            destination.
          </div>
          <div className="card-body d-flex justify-content-end">
            <a href="/sign-in" className="btn btn-secondary m-1">
              Sign In
            </a>
            <a href="/register" className="btn btn-secondary m-1">
              Register
            </a>
          </div>
        </div>
      </div>
    );
  }
}

export default HomeComponent;
